import React from 'react';
import './Node.css';
export default function Node (props) {

    const {isFinish, isStart, isWall} = props;
    let extraClassName = isFinish ? 'node-finish' : isStart ? 'node-start' : isWall ? 'node-is-wall' : '';

    const addWall = () => {
        extraClassName = 'node-is-wall';
    }


    return(
        <div 
            className={`node ${extraClassName}`}
            onClick={() => {
               addWall();
            }}
        >
        </div>
    );
}
